■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>段階圧力トレンカでふくらはぎサポート!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="610" valign="top" align="center"><div ><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0311/6186al-01.jpg" width="301" height="479"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><font size="3">【洗濯方法】<br>軽く押し洗うか、洗濯機を使用する場合はネットに入れてください。<br>・液温は、30度を限度とし、中性洗剤で弱い手洗い(振り洗い、押し洗い及びつかみ洗いがある)がよい。(洗濯機は使用できない。)<br>・塩素系漂白剤による漂白、アイロン掛け、ドライクリーニングはできません。<br>・手絞りの場合は弱く、遠心脱水の場合は、短時間で絞るのがよい。<br>・日陰のつり干しがよい。<br><br>【着用方法】<br>履き口をたぐりよせ、足首で位置を合わせたら少しずつ均等に引き上げます。</font></td></tr></table><br><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0311/6186al-02.jpg" width="600" height="809"></div><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0311/6186al-03.jpg" width="600" height="479"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><br><font size="3">ふくらはぎから足首に向かって段階的に圧力を強めていくグラデーション(段階圧力)設計。土踏まず部分は凹凸編みなので気持ちよく足裏を刺激してくれます。ムレにくく快適!さらに伸縮性があり履き心地が良いトレンカです。</font></td></tr></table></td></tr></table><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">ふくらはぎから足首に向かって段階的に圧力を強めていくグラデーション(段階圧力)設計。土踏まず部分は凹凸編みなので気持ちよく足裏を刺激してくれます。ムレにくく快適!さらに伸縮性があり履き心地が良いトレンカです。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">M-L(フリーサイズ)</font><br><font color="#333333" size="-1">個装サイズ：20×12×1cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：54g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">ナイロン、ポリウレタン</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">適応サイズ:足サイズ23～25cm、ふくらはぎ36～42cm、足首21～25cm</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
